import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import TextGenerator from './projects/projectRNN/TextGenerator';
import ModelVisualizer from './projects/projectRNN/ModelVisualizer';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Project Hub</h1>
          <nav>
            <ul>
              <li><Link to="/text-generator">Text Generator</Link></li>
              <li><Link to="/model-visualizer">Model Visualizer</Link></li>
            </ul>
          </nav>
        </header>
        <main>
          <Routes>
            <Route path="/text-generator" element={<TextGenerator />} />
            <Route path="/model-visualizer" element={<ModelVisualizer />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
